import './App.css';
import Navbar from './Navbar';
import About from './components/About';
import Services from './components/Services';
function App() {

  return (
    <div className="App">
      <div className="App">
        <About />
        <Services />
      </div>
      <Navbar />
      <div className="content">
        <h1>Site web</h1>
      </div>
    </div>
  );
}

export default App;
